prepareSounds.code:
function prepareSounds(sounds) {
	return Object.keys(sounds).map((key) => {
        return {
            value: key,
            label: sounds[key]
        };
    });
}

prepareDevices.code:
function prepareDevices(device) {
	return Object.keys(device).map((key) => {
        return {
            value: device[key],
            label: device[key]
        };
    });
}
